Write a Groovy program that uses a linked list data structure to implement a stack. The program should be able to perform the following stack operations: push (add an element to the top of the stack), pop (remove and return the top element from the stack), and peek (return the top element without removing it). Use object-oriented programming principles to design your implementation. Include a main() method that allows the user to test your program.

```groovy
import java.util.LinkedList;

class Stack {
    private LinkedList<Integer> list = new LinkedList<>();

    public void push(int value) {
        list.addFirst(value);
    }

    public int pop() {
        return list.removeFirst();
    }

    public int peek() {
        return list.getFirst();
    }

}
```


